import { Route, Navigate } from "react-router-dom";

const GuardedRoute = (props: any) => {
  if (!props.isAuth) {
    return <Navigate to={props.redirectTo} />;
  }
  return <Route path={props.path} element={<props.component />} />;
};

export default GuardedRoute;
